import React from 'react';
import '../styles/styles.css'; 

const Carousel = () => {
  return (
    <div className="carouselProducts">
      <div className="card left">Carta 1</div>
      <div className="card center">Carta 2</div>
      <div className="card right">Carta 3</div>
    </div>
  );
};

export default Carousel;
